ttings'=>'تاگل پنل:تنظیمات ','Used for hierarchical types that need a colon.'=>'برای انواع سلسله مراتبی که نیاز به کولون دارند استفاده می شود.','Slug has changed'=>'نامک تغییر کرد','Toggle panel: Basic settings'=>'تاگل پنل:تنظیمات اولیه','Import/Export Post Types'=>'درون ریزی/برون بری نوع پست ها','*Replace "post_slug" with the slug of the actual post.'=>'* "post_slug" را با نامک پست واقعی جایگزین کنید.','Get code'=>'دریافت کد','Object'=>'آبجکت','(default: false) Whether to show the taxonomy in the quick/bulk edit panel.'=>'(پیشفرض: false) نمایش طبقه بندی در پنل ویرایش سریع/گروهی','(default: false) Should the permastruct allow hierarchical urls.'=>'(پیشفرض: false) ساختار های یکتا(permastruct) URL های سلسله مراتبی را مجاز می کند.','(default: true) Whether or not WordPress should use rewrites for this taxonomy.'=>'(پیشفرض: true) وردپرس باید از بازنویسی برای این طبقه بندی استفاده کند.','(default: true) Sets the query_var key for this taxonomy.'=>'(پیشفرض: true) کلید query_var را برای این طبقه بندی تنظیم می کند.','(default: value of public) Whether to make the taxonomy available for selection in navigation menus.'=>'(پیشفرض: مقدار عمومی) طبقه بندی برای انتخاب در منوهای ناوبری در دسترس باشد.','(default: value of show_ui) Whether to show the taxonomy in the admin menu.'=>'(پیشفرض: مقدار show_ui) طبقه بندی در منوی ادمین نمایش داده شود.','(default: true) Whether to generate a default UI for managing this custom taxonomy.'=>'(پیشفرض: true)یک UI پیش فرض برای مدیریت این طبقه بندی سفارشی ایجاد می شود.','(default: true) Sets the query_var key for this post type.'=>'(پیشفرض: true) کلید query_var را برای این نوع پست تنظیم می کند.','(default: false) Whether or not the post type will have a post type archive URL.'=>'(پیشفرض: false) نوع پست، URL آرشیو نوع پست داشته باشد','(Custom Post Type UI default: true) Whether or not this post type is available for selection in navigation menus.'=>'(پیشفرض:true) موجود بودن برای انتخاب این نوع پست در منوهای ناوبری','(default: true) Whether or not to generate a default UI for managing this post type.'=>'(پیشفرض:true) تولید رابط کاربری پیشفرض برای مدیریت این نوع پست','(default: true) Whether or not queries can be performed on the front end as part of parse_request()'=>'(پیشفرض:true) اجرا شدن کوئری ها در فرانت اند به عنوان قسمتی از parse_request()','Publicly Queryable'=>'کوئری های عمومی ','(Custom Post Type UI default: true) Whether or not posts of this type should be shown in the admin UI and is publicly queryable.'=>'(پیشفرض:true)نمایش پست این نوع در رابط کابری ادمین و قابل کوئری شدن به صورت عمومی ','More from %s'=>'بیشتر از%s','Toggle panel: Additional labels'=>'پنل تاگل(باز و بسته شونده):برچسب های اضافی','Thank you for choosing Custom Post Type UI! We hope that your experience with our plugin makes creating post types and taxonomies and organizing your content quick and easy.'=>'از انتخاب رابط کاربری سفارشی نوع پست(CPT UI) متشکریم! امیدواریم شما کار کردن با افزونه ما باعث ایجاد انواع پست و طبقه بندی و سازماندهی سریع و آسان محتوای شما شود.','No it does not. The Shortcode builder is not multisite dependent and will work with either setup.'=>'نه اینطور نیست. سازنده شورتکد به چند سایتی وابسته نیست و با هر دو راه اندازی کار می کند.','Does Custom Post Type UI Extended require multisite?'=>'آیا Custom Post Type UI Extended نیاز به مولتی سایت(چند سایتی) دارد؟','Yes you will. The Custom Post Type UI Extended is not a replacement of the free version with added extra features. It acts based on the data made available through Custom Post Type UI'=>'بله. نوع CPT UI Extended جایگزین نسخه رایگان با ویژگی های اضافی نیست. این بر اساس داده های موجود از طریق CPT UI عمل می کند','Do I still need Custom Post Type UI if I purchase and install Custom Post Type UI Extended?'=>'آیا در صورت خرید و نصب CPT UI Extended ، هنوز به CPT UI نیاز دارم؟','No, there is no data being sent out from your site with these. The only way anything is tracked is via UTM parameters for WebDevStudios\'s analytics so we can get an idea of where traffic is coming from. Those are only tracked if you actually click on an ad spot.'=>'نه ، هیچ داده ای با این موارد از سایت شما ارسال نمی شود. تنها راهی که همه چیز را ردیابی می کند از طریق پارامترهای UTM برای تجزیه و تحلیل WebDevStudios است ، بنابراین ما می توانیم بفهمیم که ترافیک از کجا دریافت می شود. این موارد تنها در صورتی ردیابی می شوند که واقعاً روی یک نقطه تبلیغاتی کلیک کنید.','What does Pluginize offer?'=>'چه چیز Pluginize پیشنهاد می دهد؟','What is Pluginize?'=>'Pluginize چیست؟','Are these ad spots tracking my personal information in any way?'=>'آیا این نقاط تبلیغاتی(ad spot) به هیچ وجه اطلاعات شخصی من را ردیابی می کنند؟','You can have them automatically removed from display via a purchased copy of %s.'=>'می توانید آنها را به صورت خودکار از طریق نسخه خریداری شده در %s  حذف کنید.','How can I remove the ads that suddenly started showing up?'=>'چگونه می توانم تبلیغاتی را که ناگهان نمایش داده میشوند را حذف کنم؟','No. These spots are intended for and will only be used for other available WebDevStudios products and services.'=>'خیر. این نقاط فقط برای سایر محصولات و خدمات WebDevStudios در نظر گرفته شده و مورد استفاده قرار خواهند گرفت.','Will these ad spots ever show third-party data?'=>'آیا این نقاط تبلیغاتی(ad spots) داده های شخص ثالث را نشان می دهند؟','Pluginize offers both free and paid WordPress plugins.'=>'Pluginize افزونه های رایگان و پولی وردپرس را ارائه می دهد.','Pluginize is a marketplace of plugins by WebDevStudios.'=>'Pluginize بازار افزونه های WebDevStudios است.','CPTUI Extended'=>'CPTUI Extended','Pluginize'=>'Pluginize','Support forums'=>'انجمن‌های پشتیبانی','About'=>'درباره','(e.g. Actors list)'=>'(مثال: لیست بازیگران)','(e.g. No actors)'=>'(مثال: بدون هیچ بازیگر)','Used in the admin bar when viewing editor screen for an existing taxonomy term.'=>'هنگام مشاهده صفحه ویرایشگر برای یک شرایط طبقه بندی موجود ، در ادمین بار استفاده می شود.','The taxonomy name/slug. Used for various queries for taxonomy content.'=>'نام/نامک طبقه بندی.برای کوئری های مختلف محتوای طبقه 