ال:آپلود شده در این فیلم)','Used as the "Uploaded to this post" or "Uploaded to this page" phrase for the post type.'=>'به عنوان عبارت "آپلود شده در این پست" یا "آپلود شدهدر این صفحه" برای نوع پست استفاده می شود.','Uploaded to this Item'=>'آپلود شده در این شرایط','(e.g. Insert into movie)'=>'(مثال: قرار دادن در فیلم ها)','Used as the "Insert into post" or "Insert into page" phrase for the post type.'=>'به عنوان عبارت "درج در پست" یا "درج در صفحه" برای نوع پست استفاده می شود.','Insert into item'=>'درج در آیتم','(e.g. Movie archives)'=>'(مثال: آرشیو فیلم ها)','Post type archive label used in nav menus.'=>'برچسب آرشیو نوع پست مورد استفاده در منوهای ناوبری.','Used as the "Use as featured image" phrase for the post type.'=>'به عنوان عبارت "استفاده از تصویر شاخص" برای نوع پست استفاده می شود.','Use Featured Image'=>'استفاده از تصویر شاخص','Used as the "Remove featured image" phrase for the post type.'=>'به عنوان عبارت "حذف تصویر شاخص" برای نوع پست استفاده می شود.','Remove Featured Image'=>'حذف تصویر شاخص','(e.g. Set featured image for this movie)'=>'(مثال: عکس شاخص را برای این فیلم تنظیم کنید)','Used as the "Set featured image" phrase for the post type.'=>'به عنوان عبارت "تنظیم تصویر شاخص" برای نوع پست استفاده می شود.','(e.g. Movies list navigation)'=>'(مثال: ناوبری لیست فیلم ها)','(e.g. Use as featured image for this movie)'=>'(مثال: استفاده از عکس شاخص برای این فیلم)','(e.g. Remove featured image for this movie)'=>'(مثال:حذف عکس شاخص برای این فیلم)','Set Featured Image'=>'قرار دادن به‌عنوان تصویر شاخص','(e.g. Featured image for this movie)'=>'(مثال: عکس شاخص برای این فیلم)','Used as the "Featured Image" phrase for the post type.'=>'به عنوان عبارت "تصویر شاخص" برای نوع پست استفاده می شود.','Used when there are no posts to display on the post type list trash screen.'=>'زمانی استفاده می شود که هیچ پستی برای نمایش در سطل زباله لیست پست ها وجود نداشته باشد.','Used when there are no posts to display on the post type list screen.'=>'زمانی استفاده می شود که هیچ پستی برای نمایش در صفحه لیست نوع پست وجود نداشته باشد.','Used as the text for the search button on post type list screen.'=>'به عنوان متن برای دکمه جستجو در صفحه لیست نوع پست استفاده می شود.','Used in the admin bar when viewing editor screen for a published post in the post type.'=>'هنگام مشاهده صفحه ویرایشگر برای پست منتشر شده در نوع پست ، در ادمین بار استفاده می شود.','Used at the top of the post editor screen for an existing post type post.'=>'در بالای صفحه ویرایشگر پست برای پست نوع پست موجود استفاده می شود.','Used at the top of the post editor screen for a new post type post.'=>'در بالای صفحه ویرایشگر پست برای پست نوع پست جدید استفاده می شود.','Used in the post type admin submenu.'=>'در  زیرمنوی نوع پست ادمین استفاده می شود.','Perhaps describe what your custom post type is used for?'=>'توضیح دهید نوع پست سفارشی شما برای چه مواردی استفاده می شود','Post Type Description'=>'توضیحات نوع پست','Additional labels'=>'برچسب های اضافی','Used when a singular label is needed.'=>'هنگامی که برچسب مفرد موردنیاز است استفاده می شود','Used for the post type admin menu item.'=>'برای آیتم نوع پست منوی ادمین استفاده می شود.','DO NOT EDIT the post type slug unless also planning to migrate posts. Changing the slug registers a new post type entry.'=>'نامک نوع پست را ویرایش نکنید مگر اینکه قصد انتقال پست ها را نیز داشته باشید. تغییر نامک، یک نوع پست جدید را ثبت می کند.','The post type name/slug. Used for various queries for post type content.'=>'نام/نامک نوع پست.برای کوئری های مختلف محتوای پست استفاده می شود.','Basic settings'=>'تنظیمات اولیه','View Post Types'=>'مشاهده نوع پست ها','Are you sure you want to delete this? Deleting will NOT remove created content.'=>'آیا مطمئن هستید که می خواهید این را حذف کنید؟ حذف محتوای تولید شده را از بین نمی برد .','Custom query var slug to use instead of the default.'=>'نامک متغییر کوئری سفارشی به جای پیشفرض ستفاده می شود','Custom Query Var Slug'=>'نامک متغییر کوئری سفارشی','Show in REST API'=>'نمايش در REST API','Show in Nav Menus'=>'نمایش در منوهای ناوبری','No taxonomies registered for display. Visit %s to get started.'=>'هیچ طبقه بندی برای نمایش ثبت نشده است. برای شروع به %s مراجعه کنید.','(default: taxonomy slug). Query var needs to be true to use.'=>'(پیشفرض: نامک طبقه بندی). برای استفاده از query var باید true باشد.','I have post types with spaces in their slug and can not successfully delete them. How can I fix that?'=>'انواع پست های من که فاصله بین آنها وجود دارد و نمی توانم آنها را با موفقیت حذف کنم. چطور میتوانم آن ها را تعمیر کنم؟','(default: post type slug) Query var needs to be true to use.'=>'(پیشفرض: نامک نوع پست) برای استفاده از query var باید true باشد.','Slug to use in REST API URLs.'=>'نامک مورد استفاده در URL های REST API','REST API base slug'=>'نامک اولیه REST API','Visit the Import/Export page and copy the export code into the import side on the left. Replace the space with an underscore and then click "Import". You should be able to delete the individual post types afterwards.'=>'به صفحه درون ریزی/برون ریزی بروید و کد خروجی را در درون ریزی در سمت چپ کپی کنید. فاصله ها را با یک زیر خط جایگزین کنید و سپس روی "درون ریزی" کلیک کنید. پس از آن باید بتوانید انواع پست های شخصی را حذف کنید.','Archives'=>'بایگانی‌ها','No post types registered for display. Visit %s to get started.'=>'هیچ نوع پستی برای نمایش ثبت نشده است. برای شروع به %s مراجعه کنید.','Template hierarchy Theme Handbook'=>'دفترچه راهنمای تم سلسله مراتب قالب','Archives file name examples.'=>'مثال نام فایل آرشیو','Single Posts file name examples.'=>'مثال های نام فایل پست تکی.','Debug Info'=>'اطلاعات اشکال‌زدایی','Template Hierarchy'=>'سلسله مراتب قالب','Send debug info'=>'ارسال اطلاعات اشکال‌زدایی','Please provide an email address to send debug information to: '=>'لطفاً یک آدرس ایمیل برای ارسال اطلاعات اشکال زدایی وارد کنید:','%s Taxonomy'=>'طبقه بندی %s','%s Post Type'=>'نوع پست %s','This will not export the associated posts or taxonomy terms, just the settings.'=>' این کار پست های مرتبط یا شرایط طبقه بندی  را برون بری نمی کند، تنها تنظیمات.','What\'s 