ault.'=>'از نامک نوع پست سفارشی به جای پیشفرض استفاده کنید.','(default: post type slug)'=>'(پیشفرض: نامک نوع پست)','Custom Rewrite Slug'=>'نامک رونوشت سفارشی','Rewrite'=>'بازنویسی','Hierarchical'=>'بر اساس سلسله مراتب','Capability Type'=>'نوع قابلیت','Exclude From Search'=>'مستثنی کردن از جستجو','Has Archive'=>'آرشیو دارد','Show UI'=>'نمايش رابط کاربری','Public'=>'عمومی','(e.g. Parent Movie:)'=>'(مثال: والد فیلم:)','Parent'=>'والد','(e.g. No Movies found in Trash)'=>'(مثال: هیچ فیلمی در سطل زباله یافت نشد)','Not Found in Trash'=>'در سطل زباله یافت نشد','(e.g. No Movies found)'=>'(مثال: هیچ فیلمی یافت نشد)','True'=>'True','False'=>'False','Not Found'=>'پیدا نشد','(e.g. Search Movies)'=>'(مثال: جستجوی فیلم ها)','Search Item'=>'جستجوی آیتم ','(e.g. View Movie)'=>'(مثال: مشاهده فیلم)','View Item'=>'مشاهده آیتم‌','(e.g. New Movie)'=>'(مثال: فیلم جدید)','New Item'=>'آیتم جدید','(e.g. Edit Movie)'=>'(مثال: ویرایش فیلم ها)','Edit Item'=>'ویرایش آیتم ','(e.g. Add New Movie)'=>'(مثال: افزودن فیلم جدید)','Add New Item'=>'افزودن آیتم جدید','(e.g. Add New)'=>'(مثال: افزودن جدید)','(e.g. All Movies)'=>'(مثال: همه فیلم ها)','All Items'=>'همه آیتم ها','(e.g. My Movies)'=>'(مثال: فیلم های من)','Custom admin menu name for your custom post type.'=>'نام منوی ادمین سفارشی برای نوع پست سفارشی شما.','https://github.com/WebDevStudios/custom-post-type-ui/'=>'https://github.com/WebDevStudios/custom-post-type-ui/','(default: false) Whether to allow automatic creation of taxonomy columns on associated post-types.'=>'(پیشفرض: false) اجازه به تولید اتوماتیک ستون های طبقه بندی برای نوع پست های مرتبط','Custom taxonomy rewrite slug.'=>'نامک رونوشت طبقه بندی سفارشی','Custom Query Var String'=>'رشته سفارشی Query Var','(e.g. No Actors found)'=>'(مثال: هیچ بازیگری پیدا نشد)','(e.g. Choose from the most used Actors)'=>'(مثال: انتخاب از پراستفاده ترین بازیگرها)','(e.g. Add or remove Actors)'=>'(مثال: افزودن یا حذف بازیگرها)','(e.g. Update Actor Name)'=>'(مثال: به روزرسانی نام بازیگر)','Custom taxonomy label. Used in the admin menu for displaying taxonomies.'=>'برچسب سفارشی  طبقه بندی .در منوی ادمین برای نمایش طبقه بندی ها استفاده می شود.','Change text inside the post/page editor title field. Should be able to adapt as necessary.'=>'متن را در قسمت عنوان ویرایشگر پست/صفحه تغییر دهید. باید بتواند در صورت لزوم سازگار شود.','How do I filter the "enter title here" text in the post editor screen?'=>'چگونه می توانم متن "عنوان را در اینجا وارد کنید" را در صفحه ویرایشگر پست فیلتر کنم؟','How do I add a newly registered taxonomy to a post type that already exists?'=>'چگونه می توان طبقه بندی تازه ثبت شده را به نوع پست موجود اضافه کرد؟','How do I add custom metaboxes to my post type?'=>'چگونه می توانم متاباکس های سفارشی را به نوع پست خود اضافه کنم؟','I have added categories and tags to my custom post type, but they do not appear in the archives.'=>'من دسته ها و برچسب ها را به نوع پست سفارشی خود اضافه کرده ام ، اما در آرشیوها ظاهر نمی شوند.','How do I display my custom post type on my site?'=>'چگونه می توانم نوع پست سفارشی خود را در سایت خود نمایش دهم؟','What template files should I edit to alter my post type display?'=>'برای تغییر نوع نمایش پست خود ، چه فایلهای الگویی را باید ویرایش کنم؟','Make sure your theme has post "post-thumbnails" theme support enabled.'=>'مطمئن شوید که قالب شما پشتیبانی از "post-thumbnails" را فعال کرده است.','I have added post thumbnail and/or post format support to my post type, but those do not appear when adding a post type post.'=>'من تصویر بندانگشتی پست و/یا پشتیبانی از فرمت پست را به نوع پست خود اضافه کرده ام ، اما هنگام افزودن  نوع پست آن ، آنها ظاهر نمی شوند.','I changed my custom post type or taxonomy slug and now I have duplicates shown. How do I remove the duplicate?'=>'من نامک نوع پست یا طبقه بندی سفارشی را تغییر دادم و اکنون موارد تکراری نشان داده می شود. چگونه می توانم تکراری ها را حذف کنم؟','I changed my custom post type name and now I can not get to my posts. How do I get them back?'=>'من نام نوع پست سفارشی خود را تغییر دادم و اکنون نمی ت